// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Produce {
    enum SEASON {
        WINTER,
        FALL,
        SUMMER,
        SPRING
    }

    ProduceDetails produceDetails;

    struct ProduceDetails {
        uint256 seedType;
        SEASON season;
    }

    constructor(uint256 _seedType) {
        produceDetails.seedType = _seedType;
    }

    function getProduceDetails() public view returns (ProduceDetails memory) {
        return produceDetails;
    }

    function setSeason(string memory _season) public returns (uint) {
              bytes memory _seasonB = bytes(_season);
        bytes32 Hash = keccak256(_seasonB);
                // Loop to check
        if (Hash == keccak256("Winter") || Hash == keccak256("winter")) produceDetails.season=SEASON.WINTER;

        revert();

}
}
